script: |
  super -f text -I q3278.spq | sort > q3278.out

inputs:
  - name: q3278.spq
    data: |
      SELECT ALL + col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + - ( + col1 ) + - 69 IN ( + 91, col1 * - + 2 + - col0 );
  - name: tab0

outputs:
  - name: q3278.out
    data: |
      1
      21
      81
